import React, { useState } from 'react';
import axios from 'axios';

const SignUpForm = () => {
  const [formData, setFormData] = useState({
    fullName: '',
    gender: '',
    nationality: '',
    ageGroup: '',
    course: '',
    academicLevel: '',
    subjectsEnrolled: '',
    studyPreference: '',
    availability: '',
    learningStyle: '',
    motivationalFactors: '',
    studyEnvironment: '',
    academicSkills: '',
    hobbies: '',
    interests: '',
    careerAspirations: '',
    communicationChannels: '',
    toolsProficiency: '',
    locationPreference: '',
    languagesSpoken: '',
    studyPartnerPreference: '',
    groupProjectExperience: '',
    willingnessToMentor: ''
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prevState => ({
      ...prevState,
      [name]: value
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('/api/signup', formData);
      console.log('Sign up successful', response.data);
      // Handle successful signup (e.g., redirect, show success message)
    } catch (error) {
      console.error('Sign up failed', error);
      // Handle error (e.g., show error message)
    }
  };

  return (
    <form onSubmit={handleSubmit} className="signup-form max-w-4xl mx-auto p-6 bg-gray-50 rounded-lg shadow-lg animation-fadeIn">
      <h2 className="text-3xl font-bold mb-6 text-center text-gray-800">Student Sign Up</h2>

      {/* Personal Information Section */}
      <section className="mb-8 bg-white p-6 rounded-md shadow-md animation-fadeIn">
        <h3 className="text-xl font-semibold mb-4 text-gray-700 border-b pb-2">Personal Information</h3>
        <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
          <input
            type="text"
            name="fullName"
            value={formData.fullName}
            onChange={handleChange}
            placeholder="Full Name"
            className="w-full p-3 border border-gray-300 rounded-md focus:ring-2 focus:ring-blue-500 focus:border-blue-500 transition duration-150 ease-in-out"
            required
          />
          <select
            name="gender"
            value={formData.gender}
            onChange={handleChange}
            className="w-full p-3 border border-gray-300 rounded-md focus:ring-2 focus:ring-blue-500 focus:border-blue-500 transition duration-150 ease-in-out bg-white"
            required
          >
            <option value="">Select Gender</option>
            <option value="male">Male</option>
            <option value="female">Female</option>
            <option value="other">Other</option>
          </select>
          <input
            type="text"
            name="nationality"
            value={formData.nationality}
            onChange={handleChange}
            placeholder="Nationality"
            className="w-full p-3 border border-gray-300 rounded-md focus:ring-2 focus:ring-blue-500 focus:border-blue-500 transition duration-150 ease-in-out"
            required
          />
          <select
            name="ageGroup"
            value={formData.ageGroup}
            onChange={handleChange}
            className="w-full p-3 border border-gray-300 rounded-md focus:ring-2 focus:ring-blue-500 focus:border-blue-500 transition duration-150 ease-in-out bg-white"
          >
            <option value="">Select Age Group (Optional)</option>
            <option value="18-22">18-22</option>
            <option value="23-27">23-27</option>
            <option value="28+">28+</option>
          </select>
        </div>
      </section>

      {/* Academic Information Section */}
      <section className="mb-8 bg-white p-6 rounded-md shadow-md animation-fadeIn">
        <h3 className="text-xl font-semibold mb-4 text-gray-700 border-b pb-2">Academic Information</h3>
        <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
          <select
            name="course"
            value={formData.course}
            onChange={handleChange}
            className="w-full p-3 border border-gray-300 rounded-md focus:ring-2 focus:ring-blue-500 focus:border-blue-500 transition duration-150 ease-in-out bg-white"
            required
          >
            <option value="">Select Course</option>
            <option value="masters">Master's</option>
            <option value="bachelors">Bachelor's</option>
          </select>
          <input
            type="text"
            name="academicLevel"
            value={formData.academicLevel}
            onChange={handleChange}
            placeholder="Semester/Academic Level"
            className="w-full p-3 border border-gray-300 rounded-md focus:ring-2 focus:ring-blue-500 focus:border-blue-500 transition duration-150 ease-in-out"
            required
          />
          <input
            type="text"
            name="subjectsEnrolled"
            value={formData.subjectsEnrolled}
            onChange={handleChange}
            placeholder="Subjects Enrolled"
            className="w-full p-3 border border-gray-300 rounded-md focus:ring-2 focus:ring-blue-500 focus:border-blue-500 transition duration-150 ease-in-out"
            required
          />
          <select
            name="studyPreference"
            value={formData.studyPreference}
            onChange={handleChange}
            className="w-full p-3 border border-gray-300 rounded-md focus:ring-2 focus:ring-blue-500 focus:border-blue-500 transition duration-150 ease-in-out bg-white"
            required
          >
            <option value="">Study Preference</option>
            <option value="group">Group</option>
            <option value="individual">Individual</option>
          </select>
          <textarea
            name="availability"
            value={formData.availability}
            onChange={handleChange}
            placeholder="Availability for the Week"
            className="w-full p-3 border border-gray-300 rounded-md focus:ring-2 focus:ring-blue-500 focus:border-blue-500 transition duration-150 ease-in-out resize-none"
            rows="3"
            required
          ></textarea>
        </div>
      </section>

      {/* Other sections omitted for brevity but follow the same structure */}

      <button
        type="submit"
        className="w-full bg-blue-600 text-white px-6 py-3 rounded-md hover:bg-blue-700 focus:outline-none focus:ring-2 focus:ring-blue-500 focus:ring-offset-2 transition duration-150 ease-in-out font-semibold text-lg"
      >
        Sign Up
      </button>
    </form>
  );
};

export default SignUpForm;
